import React, { useEffect, useState, useRef } from 'react';
import { useLocation } from 'react-router-dom';
import './Completeview.css';
import LocalMallIcon from '@mui/icons-material/LocalMall';
import AddShoppingCartIcon from '@mui/icons-material/AddShoppingCart';
import { IconButton, InputBase, AppBar, Toolbar, Typography, Box, Drawer, List, ListItem, ListItemIcon, ListItemText, Popover, Paper, Divider, Avatar } from '@mui/material';

import size from './size.webp'


const CompleteView = () => {
  const location = useLocation();
  const { product } = location.state;
  const [initialLoad, setInitialLoad] = useState(true);

  useEffect(() => {
    // Trigger zoom-in effect on initial load
    const timer = setTimeout(() => {
      setInitialLoad(false);
    }, 1000); // Duration for initial zoom-in effect

    return () => clearTimeout(timer);
  }, []);

  const [popupOpen, setPopupOpen] = useState(false);
  const popupRef = useRef(null);

  const handleClickOutside = (event) => {
    if (popupRef.current && !popupRef.current.contains(event.target)) {
      setPopupOpen(false);
    }
  };

  useEffect(() => {
    if (popupOpen) {
      document.addEventListener('mousedown', handleClickOutside);
    } else {
      document.removeEventListener('mousedown', handleClickOutside);
    }

    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, [popupOpen]);

  return (
    <div className="complete-view">
      <div className="frames">
        <div className="frame">
          <img
            src={product.imgSrc}
            alt={product.title}
            className={initialLoad ? 'initial-zoom' : ''}
          />
        </div>

        <div className="frame">
          <img
            src={product.altImgSrc || product.imgSrc}
            alt={product.title}
            className={initialLoad ? 'initial-zoom' : ''}
          />
        </div>

        <div className="frame">
          <img
            src={product.imgSrc}
            alt={product.title}
            className={initialLoad ? 'initial-zoom' : ''}
          />
        </div>

        <div className="frame">
          <img
            src={product.altImgSrc || product.imgSrc}
            alt={product.title}
            className={initialLoad ? 'initial-zoom' : ''}
          />
        </div>
      </div>

      <div className="right-side">
        <h2>{product.title}</h2>
        <div className="product-details">
          <p>{product.price}</p>
          <div className="rating">
            {'⭐'.repeat(product.rating)}
          </div>
          <span style={{ fontSize: '20px', color: 'green' }}>Sizes</span><br />

          <div className="sizes">
            {product.sizes.map(size => (
              <span key={size} className="size">{size}</span>
            ))}

</div>

            
<button style={{ fontSize: '20px', color: 'white', backgroundColor: 'black', borderRadius: '3px' }} onClick={() => setPopupOpen(true)}>Helps</button>
{popupOpen && (
  <div ref={popupRef} className="popup-overlay">
    <Paper className="popup-content" style={{ overflow: 'auto', height: '300px', width: '500px' }}>
      <img src={size} alt="" style={{ width: '100%' }} />
    </Paper>
  </div>
)}


          <div className="shoppingbtn" style={{ display: 'flex', backgroundColor: '', paddingTop: '20px', width: '100%' }}>
            <List style={{ display: 'flex', width: 'auto', gap: '20px' }}>
              <ListItem button style={{ width: '200px', backgroundColor: 'rgb(251,100,27)' }}>
                <ListItemIcon style={{ color: 'white' }}>
                  <LocalMallIcon style={{ color: 'black' }} />
                </ListItemIcon>
                <ListItemText primary="Buy Now" />
              </ListItem>

              <ListItem button style={{ width: '200px', backgroundColor: 'rgb(255,159,10)' }}>
                <ListItemIcon style={{ color: 'white' }}>
                  <AddShoppingCartIcon style={{ color: 'black' }} />
                </ListItemIcon>
                <ListItemText primary="Add To Cart" />
              </ListItem>
            </List>
          </div>

        </div>
      </div>
    </div>
  );
};

export default CompleteView;
